import React, { Component, useEffect, useState } from "react";

const UsersList = () => {
  return (
    <div>
      <h1>Lists of Current Users</h1>
      <table>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>User Type</th>
          <th>Delete Account</th>
        </tr>
      </table>
    </div>
  );
};
export default UsersList;
